import Link from 'next/link';
import navbar from '../components/navbar';

const Index = () => (
    <div>
        <nav>
            <ul>
                <Link href="#"><li>Home</li></Link>
                <Link href="about"><li>About</li></Link>
                <li>Contact</li>
                <li>FAQ</li>
            </ul>
        </nav>
    </div>
)

export default Index;
